var title_f43_16_44298="Right bundle branch block 1";
var content_f43_16_44298=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F65619%7ECARD%2F64393&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F65619%7ECARD%2F64393&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 508px\">",
"   <div class=\"ttl\">",
"    Complete right bundle branch block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 488px; height: 142px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The initial myocardial activation is normal; thus, there is a normal septal q wave in leads 1 and V6, followed by a tall R wave. Similarly, there is a normal initial septal R wave followed by a deep S wave in leads aVR and V1. However, the subsequent abnormal right ventricular activation occurs from left to right and goes through the ventricular myocardium instead of the His-Purkinje system; thus, there will be a tall and broad secondary R wave (R') in leads aVR and V1 (a RSR' complex), and a deep and broad S wave in leads I and V6. The width of the QRS complex is &gt;0.12 sec.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1212px;\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    Common RBBB",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 293px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram showing characteristic changes in the precordial leads in common RBBB. The asynchronous activation of the two ventricles increases the QRS duration (0.13 sec). The terminal forces are rightward and anterior due the delayed activation of the right ventricle, resulting in an rsR' pattern in the anterior-posterior lead V1 and a wide negative S wave in the left-right lead V6 (and, not shown, in lead I).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 594px\">",
"   <div class=\"ttl\">",
"    Normal ECG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 594px; height: 337px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal electrocardiogram showing normal sinus rhythm at a rate of 75 beats/min, a PR interval of 0.14 sec, a QRS interval of 0.10 sec, and a QRS axis of approximately 75&deg;.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
